import React from "react";
import MyHeader from "../components/MyHeader";
import MyButton from "../components/MyButton";

const New = () => {
  return (
    <div>
      <MyHeader
        headerText={"새 일기 쓰기"}
        leftChild={<MyButton text={"< 뒤로 가기"} />}
      />
    </div>
  );
};

export default New;
